Validators, please note that action is required from you from the latest release. Please make sure you’ve accepted the terms for https://huggingface.co/datasets/bigcode/the-stack-dedup and have configured your hugging face token as detailed in https://github.com/macrocosm-os/pretraining/blob/main/docs/validator.md. 

